import React from "react";
import StatusBadge from "../components/StatusBadge";

function Profile() {
  return (
    <div>
      <h2>Profile Page</h2>
      <p>This is your profile information.</p>
      <p>
        Status: <StatusBadge status="active" />
      </p>
    </div>
  );
}

export default Profile;
